import React from 'react';
import {InputBase, InputAdornment, SearchRoundedIcon} from "@material-ui/core";


export default React.memo(()=>{
  return(
    <InputBase
      placeholder="Search..."
      size="small"
      className="px-2 mx-5 bg-light rounded shadow"
      startAdornment={
        <InputAdornment className="p-0" position="start">
          <SearchRoundedIcon className="p-0" color="primary"/>
        </InputAdornment>
      }
    />
  )
})
